import React from 'react'
import {AppBar, Toolbar, Typography} from '@material-ui/core'

const Navbar=()=>{
    return(
        <React.Fragment>
            <AppBar sx={{background: "#063970"}}>
                <ToolBar>
                    <Typography>Rooster</Typography>
                </ToolBar>
            </AppBar>
        </React.Fragment>
    );
};



export default Navbar;
